import Scrollbar from "smooth-scrollbar";
import Snackbar from "node-snackbar";
import Route from "/src/router/index";

import Store from "/src/store";
const $ = require("jquery");

if (typeof window !== "undefined") {
  window.$ = $;
  window.jQuery = $;
  require("/node_modules/bootstrap/js/src/tab");
}

export const xray = {
  index() {
    this.loaderInit();
    this.activeRoute();
    this.SmoothScrollbar();
    this.Accordian();
    this.progressBar();
  },
  mainIndex() {
    this.ripple();
    this?.fullscreen();
    this.sideBarToggle();
    this.navBarAction();
    this?.AccordianInit();
    this.fixedHeader();
    this.chat();
  },
  loaderInit() {
    let load = document.getElementById("loading");
    animation.fadeOut(load, { duration: 0 });
    animation.fadeOut(load, { duration: 1400 });
    setTimeout(() => {
      load.classList.add("d-none");
    }, 1400);
  },
  activeRoute() {
    if (
      typeof Route.currentRoute.meta !== "undefined" &&
      typeof Route.currentRoute.meta.name !== "undefined"
    ) {
      let obj = {
        name: Route.currentRoute.meta.name,
        breadCrumb: [
          {
            html: '<i class="ri-home-4-line mr-1 float-left"></i>Home',
            to: { name: "mini.dashboard.home-1" },
          },
          {
            text: Route.currentRoute.meta.name,
            href: "#",
          },
        ],
        bookmark: true,
      };
      Store.dispatch("Setting/activePageAction", obj);
    }
  },
  progressBar() {
    $(".iq-progress-bar > span").each(function () {
      let progressBar = $(this);
      let width = $(this).data("percent");
      // console.log(width);
      progressBar.css({
        transition: "width 2s",
      });

      setTimeout(function () {
        progressBar.css("width", width + "%");
      }, 100);
    });

    $(".progress-bar-vertical > span").each(function () {
      let progressBar = $(this);
      let height = $(this).data("percent");
      progressBar.css({
        transition: "height 2s",
      });

      setTimeout(function () {
        progressBar.css("height", height + "%");
      }, 100);
    });
  },
  fixedHeader() {
    $(window).scroll(function () {
      if ($(window).scrollTop() >= 75) {
        $(".iq-top-navbar")?.addClass("fixed-header");
      } else {
        $(".iq-top-navbar")?.removeClass("fixed-header");
      }
    });
  },
  ripple() {
    $(document).on("click", ".iq-waves-effect", function (e) {
      // Remove any old one
      $(".ripple").remove();
      // Setup
      let posX = $(this).offset().left;
      let posY = $(this).offset().top;
      let buttonWidth = $(this).width();
      let buttonHeight = $(this).height();

      // Add the element
      $(this).prepend("<span class='ripple'></span>");

      // Make it round!
      if (buttonWidth >= buttonHeight) {
        buttonHeight = buttonWidth;
      } else {
        buttonWidth = buttonHeight;
      }

      // Get the center of the element
      let x = e.pageX - posX - buttonWidth / 2;
      let y = e.pageY - posY - buttonHeight / 2;

      // Add the ripples CSS and start the animation
      $(".ripple")
        .css({
          width: buttonWidth,
          height: buttonHeight,
          top: y + "px",
          left: x + "px",
        })
        .addClass("rippleEffect");
    });
  },

  fullscreen() {
    const elementExist = this?.checkElement("class", "iq-full-screen");
    if (!elementExist) {
      $(document)?.on("click", ".iq-full-screen", function () {
        let elem = $(this);
        if (
          !document.fullscreenElement &&
          !document.mozFullScreenElement &&
          !document.webkitFullscreenElement &&
          !document.msFullscreenElement
        ) {
          if (document.documentElement.requestFullscreen) {
            document.documentElement.requestFullscreen();
          } else if (document.documentElement.mozRequestFullScreen) {
            document.documentElement.mozRequestFullScreen();
          } else if (document.documentElement.webkitRequestFullscreen) {
            document.documentElement.webkitRequestFullscreen(
              Element.ALLOW_KEYBOARD_INPUT
            );
          } else if (document.documentElement.msRequestFullscreen) {
            document.documentElement.msRequestFullscreen(
              Element.ALLOW_KEYBOARD_INPUT
            );
          }
        } else {
          if (document.cancelFullScreen) {
            document.cancelFullScreen();
          } else if (document.mozCancelFullScreen) {
            document.mozCancelFullScreen();
          } else if (document.webkitCancelFullScreen) {
            document.webkitCancelFullScreen();
          } else if (document.msExitFullscreen) {
            document.msExitFullscreen();
          }
        }
        elem
          .find("i")
          .toggleClass("ri-fullscreen-line")
          .toggleClass("ri-fullscreen-exit-line");
      });
    }
  },
  triggerSet() {
    const elementExist = this.checkElement("class", "wrapper-menu");
    if (elementExist) {
      let wrapperMenu = document.querySelector(".wrapper-menu");
      let body = document.querySelector("body");
      this.sidebarMiniSetEvent(wrapperMenu, body);
      /* for (let i = 0; i < wrapperMenu.length; i++) {
      } */
    }
  },

  sidebarMiniSetEvent(element, target) {
    element.classList.toggle("open");
    target.classList.toggle("sidebar-main");
  },
  checkClass(ele, type, className) {
    switch (type) {
      case "addClass":
        if (!ele.hasClass(className)) {
          ele.addClass(className);
        }
        break;
      case "removeClass":
        if (ele.hasClass(className)) {
          ele.removeClass(className);
        }
        break;
      case "toggleClass":
        ele.toggleClass(className);
        break;
    }
  },

  sideBarToggle() {
    const elementExist = this.checkElement("class", "iq-sidebar-menu");
    if (elementExist !== null && elementExist !== undefined) {
      $(document).on("click", ".iq-sidebar-menu li", function () {
        if ($(this).hasClass("menu-open")) {
          $(this).find(".iq-submenu").slideUp("slow");
          xray.checkClass($(this), "removeClass", "menu-open");
          if ($(this).find(".iq-submenu .menu-open").length) {
            xray.checkClass(
              $(this).find(".menu-open"),
              "removeClass",
              "menu-open"
            );
          } else {
            xray.checkClass(
              $(this).find(".iq-submenu"),
              "removeClass",
              "menu-open"
            );
          }
        } else if ($(this).find(".iq-submenu").length) {
          $(this).find(".iq-submenu").slideDown("slow");
          xray.checkClass($(this), "addClass", "menu-open");
          xray.checkClass($(this).find(".iq-submenu"), "addClass", "menu-open");
        }
      });
    }
  },

  navBarAction() {
    $(document).on("click", ".iq-sub-dropdown", function (e) {
      e.stopPropagation();
    });
    $(document).on("click", function (e) {
      let myTargetElement = e.target;
      let selector, mainElement;
      if (
        $(myTargetElement).hasClass("search-toggle") ||
        $(myTargetElement).parent().hasClass("search-toggle") ||
        $(myTargetElement).parent().parent().hasClass("search-toggle")
      ) {
        if ($(myTargetElement).hasClass("search-toggle")) {
          selector = $(myTargetElement).parent();
          mainElement = $(myTargetElement);
        } else if ($(myTargetElement).parent().hasClass("search-toggle")) {
          selector = $(myTargetElement).parent().parent();
          mainElement = $(myTargetElement).parent();
        } else if (
          $(myTargetElement).parent().parent().hasClass("search-toggle")
        ) {
          selector = $(myTargetElement).parent().parent().parent();
          mainElement = $(myTargetElement).parent().parent();
        }
        if (
          !mainElement.hasClass("active") &&
          $(".navbar-list li").find(".active")
        ) {
          $(".navbar-list li").removeClass("iq-show");
          $(".navbar-list li .search-toggle").removeClass("active");
        }

        selector.toggleClass("iq-show");
        mainElement.toggleClass("active");

        e.preventDefault();
      }
      // else if ($(myTargetElement).is('.search-input')){ }
      else {
        $(".navbar-list li").removeClass("iq-show");
        $(".navbar-list li .search-toggle").removeClass("active");
      }
    });
  },
  checkElement(type, element) {
    let found = false;
    let elements;
    switch (type) {
      case "class":
        elements = document.getElementsByClassName(element);
        if (
          elements !== undefined &&
          elements !== null &&
          elements.length > 0
        ) {
          found = true;
        }
        break;

      case "id":
        elements = document.getElementById(element);

        if (elements !== undefined && elements !== null) {
          found = true;
        }
        break;
    }
    return found;
  },

  owlCarousel() {},

  SmoothScrollbar() {
    const elementExistMain = this.checkElement("id", "sidebar-scrollbar");
    if (elementExistMain) {
      Scrollbar.init(document.querySelector("#sidebar-scrollbar"));
    }
    const elementExistRight = this.checkElement(
      "id",
      "right-sidebar-scrollbar"
    );
    if (elementExistRight) {
      Scrollbar.init(document.querySelector("#right-sidebar-scrollbar"));
    }
  },

  Accordian() {
    $(".iq-accordion .iq-accordion-block .accordion-details").hide();
    $(".iq-accordion .iq-accordion-block:first")
      .addClass("accordion-active")
      .children()
      .slideDown("slow");
  },

  AccordianInit() {
    $(document).on("click", ".iq-accordion .iq-accordion-block", function () {
      if ($(this).children("div.accordion-details ").is(":hidden")) {
